import React, { useState, useEffect } from 'react';

import "../CoreStyle.css";
import "./ComponentsStyle.css";
import { FormMessage, TextField, Select} from "@react-md/form";
import { FaCarSide } from 'react-icons/fa';


export function C_Modal(props) {


    function closeModal(){
        if (props.onClose)
            props.onClose();
    }

    return (
        <>
            {props.show ?
                <div className="modal-background fade-in">

                    <div className={`${props.size === "large" ? props.size : `default`}-modal `}>

                        <div className="header-modal" >
                            <p className="tittle-modal">{props.tittle}</p>
                            <C_Icon style={{ position: "absolute", right: 0, top: 15,color:"gray"}} onClick={closeModal} icon="close" />
                        </div>

                        <div className="body-modal">
                           {props.children}
                        </div>
                        
                        <div className="footer-modal">
                            <C_Button themeType="outline" onClick={closeModal} label="Cancelar" />
                            <C_Button style={{marginLeft:10}} label="Cadastrar" onClick={props.onSave} />
                        </div>
                        

                    </div>

                </div>
            : undefined}
        </>
    )
}

export function C_TextField(props){
    
    var style = props.style ? props.style : {};

    return (
        <div style={{display:"flex",alignItems:"center"}}>
            <FontIcon style={{marginRight:"10px"}}>{props.icon}</FontIcon>

            <TextField
                theme={"outline"}
                label={props.label}
                placeholder={props.placeholder}
                value={props.value}
                style={style}

            />
        </div>
    )
}

export function C_SelectField(props){
    
    var style = props.style ? props.style : {};

    return (
        <div style={{display:"flex",alignItems:"center"}}>
            <FontIcon style={{marginRight:"10px"}}>{props.icon}</FontIcon>

            <Select
                theme={"outline"}
                label={props.label}
                placeholder={props.placeholder}
                value={props.value}
                style={style}
                value={props.value}
                onChange={props.onChange}
                options={["left", "center", "right"]}

            />
        </div>
    )
}

export function C_SelectVehicle(props){
    
    const vehicleOptions = ["Carro","Moto","Bicicleta"];

    const [vehicle, setVehicle] = useState("Carro");
    

    var style = props.style ? props.style : {};

    function onChange(undefined,item){

        setVehicle(item);
        if(props.onChange)
            props.onChange(item);
    }

    return (
        <div style={{display:"flex",alignItems:"center"}}>
            {vehicle == "Carro" ?
                <span style={{ color: "#757575",marginRight: "10px",fontSize:24}}>
                    <FaCarSide/> 
                </span>
            :
                <FontIcon style={{ marginRight: "10px" }}>
                    {vehicle == "Moto" ? "two_wheeler" : "pedal_bike"}
                </FontIcon>
            }
            

            <Select
                theme={"outline"}
                label={"Veiculo"}
                style={style}
                onChange={onChange}
                options={vehicleOptions}
                value={vehicle}
            />
          
        </div>
    )
}
export function C_SelectVehicleBrand(props){
    
    var style = props.style ? props.style : {};

    return (
        <div style={{display:"flex",alignItems:"center"}}>

            <Select
                theme={"outline"}
                label={"Marca"}
                style={style}
                onChange={props.onChange}
                options={["Alfa Romeo", "Audi", "Bentley"]}

            />
        </div>
    )
}
